import Books from './Books';
import {BrowserRouter,Routes,Route} from 'react-router-dom';
import Add from './Add';
import Update from './Update';

function App() {
  return (
    <div className=" ">
      <header className="App-header flex justify-between items-center mx-8 sticky z-40">
        <p className='text-blue-700 text-3xl font-bold px-4 pt-3 mb-4 uppercase'>
          Bookshop
        </p>
        <button className='bg-blue-700 rounded-md px-4 h-8 '><a href='add'>Add Book</a></button>

      </header>
      <hr/>

      <div className=" ">
        <BrowserRouter>
        <Routes>
          <Route path="/" element={<Books/>}/>
          <Route path="/add" element={<Add/>}/>
          <Route path="/edit" element={<Update/>}/>
        </Routes>
        </BrowserRouter>
      </div>
    </div>
  );
}

export default App;
